import React from "react";
import ReactDOM from "react-dom";
import Header from "./Header";
import Nav from "./Nav";
import "./index.css";
import ToSecData , {FourImgData} from "./TwoSecData";
import TwoSec from "./TwoSec";
import TextSec from "./TextSec";
import FourImgSec from "./FourImgSec";
import Footer from "./Footer";


function Two(value){
    return(
         <TwoSec imgSrc={value.imgSrc}
             h6={value.h6}
             h2={value.h2}
             para={value.para}
         />
    )
}

function ImgData(values){
    return(
         <FourImgSec img={values.img}/>
    )
}

ReactDOM.render(
     <>
         <Nav/>
         <Header/>
         <div className="two-section">
                 {ToSecData.map(Two)}
         </div>
         <div className="text-sec">
              <TextSec/>
         </div>
         <div className="img-text-sec">
         <TextSec/>
         </div>

         <div className="four-img-section">
             {FourImgData.map(ImgData)}
         </div>

         <div>
             <Footer/>
         </div>
     </>,document.getElementById("root")
);
